/* Trigger structure for table `ez_payment_info` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `prevent_insert_if_success` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `prevent_insert_if_success` BEFORE INSERT ON `ez_payment_info` FOR EACH ROW BEGIN
    
      SELECT COUNT(*) INTO @success FROM ez_payment_info WHERE applid = NEW.applid AND payment_status = '00' LIMIT 1;

	    IF (@success > 0) THEN
		SIGNAL SQLSTATE '45000' 
		    SET MESSAGE_TEXT = 'Payment already success, cannot insert more status';
	    END IF;

    END */$$


DELIMITER ;

/* Trigger structure for table `ez_payment_info` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `update_payment_status` */$$

/*!50003 CREATE */ /*!50003 TRIGGER `update_payment_status` AFTER UPDATE ON `ez_payment_info` FOR EACH ROW BEGIN
    
    SET @module_id = SUBSTRING(new.applid, 9, 2);  
    

    IF new.payment_status <> '00'
	THEN
	    UPDATE mobile_invoice SET payment_status = 'PP' WHERE appl_id = new.applid;
	    IF @module_id = 10 THEN
		UPDATE application_mar_info SET appl_status = 'PP' WHERE appl_id = new.applid;
	     ELSEIF @module_id = 60 THEN
		UPDATE application_kp13 SET `status` = 'PP' WHERE appl_id = new.applid;   
	     END IF; 
    ELSEIF new.payment_status = '00'
	THEN
	     UPDATE mobile_invoice SET payment_status = 'P' WHERE appl_id = new.applid;
	     IF @module_id = 10 THEN
		UPDATE application_mar_info SET appl_status = 'C' WHERE appl_id = new.applid;
	     ELSEIF @module_id = 60 THEN
		UPDATE application_kp13 SET `status` = 'C' WHERE appl_id = new.applid; 
	     END IF; 
    END IF;
END */$$


DELIMITER ;

