/*!50106 CREATE EVENT `update_application_status` ON SCHEDULE EVERY 1 HOUR STARTS '2023-03-07 17:19:52' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	
	
	    SELECT active_status INTO @schedule_status FROM scheduler_settings WHERE scheduler_code = 1;
	    	    
	    IF (@schedule_status = 1)
