/* Procedure structure for procedure `update_status_kp13` */

/*!50003 DROP PROCEDURE IF EXISTS  `update_status_kp13` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `update_status_kp13`()
BEGIN
  DECLARE done INT DEFAULT 0;

                DECLARE applIdKp13 VARCHAR(255);

                DECLARE createdKp13 DATE;

                DECLARE cur_kp13 CURSOR FOR SELECT appl_id, CAST(created AS DATE) FROM mobile_invoice;

                DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

                      OPEN cur_kp13;
                        label: LOOP
                                FETCH cur_kp13 INTO applIdKp13, createdKp13;

                                IF (DATEDIFF(CURDATE(),createdKp13) > 14)
                                        THEN 
                                            UPDATE application_kp13 SET `Status` = 'X', updated = NOW() WHERE appl_id = applIdKp13 AND `Status` != 'C';
					    UPDATE mobile_invoice SET payment_status = 'X', updated = NOW() WHERE appl_id =  applIdKp13 AND payment_status != 'P';
                                            UPDATE ez_payment_details SET payment_status = 'X' WHERE appl_id =  applIdKp13 AND payment_status != 'P';
                                END IF;

                                IF done = 1 
                                        THEN LEAVE label;
                                END IF;
                        END LOOP;
                      CLOSE cur_kp13;

	END */$$
DELIMITER ;

