insert  into `tnc_info`(`tnc_id`,`module_type`,`tnc_desc`,`tnc_date`) values 
(1,'kematian','TERMA DAN SYARAT \n\nCABUTAN DAFTAR KEMATIAN \n\n \nNo. 1: Pemohon yang layak membuat permohonan adalah waris (Ibu / Bapa / Suami / Isteri / Anak / Adik - Beradik / Datuk / Nenek / Cucu). \n\n\nNo. 2: Permohonan Cabutan Sijil Kematian / Cabutan Yang Diperakui dalam talian adalah bagi individu (si mati) yang mempunyai kad pengenalan 12 digit sahaja. \n\n\nNo. 3: Pusat kutipan bagi permohonan Cabutan Sijil Kematian / Cabutan Yang Diperakui dalam talian adalah: \n\na) Kematian semenanjung - di mana-mana JPN di Semenanjung / JPN Sabah / JPN Sarawak / JPN Labuan ; \n \nb) Kematian Sabah/Labuan - di mana-mana cawangan JPN di Negeri Sabah / Ibu Negeri JPN Sarawak / JPN Labuan / JPN Ibu Pejabat Putrajaya / JPN Negeri di Semenanjung; dan \n \nc) Kematian Sarawak - di mana-mana cawangan JPN di Negeri Sarawak / Ibu Negeri JPN Sabah / JPN Labuan / JPN Ibu Pejabat Putrajaya / JPN Negeri di Semenanjung. \n \n\nNo. 4: Bayaran bagi permohonan Cabutan Sijil Kematian / Cabutan Yang Diperakui dalam talian sebanyak RM5.00 hendaklah dibuat di kaunter JPN semasa proses kutipan Cabutan Sijil Kematian / Cabutan Yang Diperakui. \n\n \n No. 5: Tempoh hadir bagi kutipan Cabutan Sijil Kematian / Cabutan Yang Diperakui adalah 3 bulan dari tarikh permohonan dibuat. \n\n \nNo. 6: Pemohon yang layak perlu hadir bersama slip permohonan sama ada dalam bentuk soft copy atau salinan yang dicetak. \n \n \nNo. 7: Permohonan akan ditolak sekiranya tidak memenuhi syarat yang ditetapkan. \n \n \nNo. 8: Bagi permohonan yang gagal, JPN boleh mempertimbangkan pengeluaran JPN.LM14 dengan fi RM10.00. \n\n','2023-03-08'),
(2,'lahir','TERMA DAN SYARAT   \n\nCABUTAN SIJIL KELAHIRAN   \n\n1. Pemilik Sijil Kelahiran bukan berstatus anak angkat.  \n\n2. Pemohon yang layak membuat permohonan adalah: \na) Pemilik Sijil Kelahiran yang memiliki Kad Pengenalan 12 Digit; dan \nb) Waris (Ibu/Bapa/Suami/Isteri/Anak/Adik Beradik).  \n\n3. Pusat kutipan bagi permohonan Cabutan Sijil Kelahiran/Cabutan Yang Diperakui dalam talian adalah: \na) Kelahiran semenanjung - di mana-mana JPN di Semenanjung/JPN Sabah/JPN Sarawak/JPN Labuan; \nb) Kelahiran Sabah/Labuan - di mana-mana cawangan JPN di Negeri Sabah/Ibu Negeri JPN Sarawak/JPN Labuan/JPN Ibu Pejabat Putrajaya/JPN Negeri di Semenanjung; dan \nc) Kelahiran Sarawak - di mana-mana cawangan JPN di Negeri Sarawak/Ibu Negeri JPN Sabah/JPN Labuan/JPN Ibu Pejabat Putrajaya/JPN Negeri di Semenanjung.  \n\n4. Bayaran bagi permohonan Cabutan Sijil Kelahiran/Cabutan Yang Diperakui dalam talian adalah: \na) Diri Sendiri - bayaran sebanyak RM5.00 hendaklah dibuat secara dalam talian. \nb) Waris (Ibu/Bapa/Suami/Isteri/Anak/Adik - Beradik) - bayaran sebanyak RM5.00 hendaklah dibuat di kaunter JPN semasa proses kutipan Cabutan Sijil Kelahiran/Cabutan Yang Diperakui.  \n\n5. Tempoh hadir bagi kutipan Cabutan Sijil Kelahiran/Cabutan Yang Diperakui adalah 3 bulan dari tarikh permohonan dibuat.  \n\n6. Pemohon yang layak perlu hadir bersama slip permohonan sama ada dalam bentuk soft copy atau salinan yang dicetak.  \n\n7. Permohonan akan ditolak sekiranya tidak memenuhi syarat yang ditetapkan.  \n\n8. Wang tidak akan dikembalikan jika pemohon tidak hadir untuk membuat kutipan. \n\n9. Bagi permohonan yang gagal, JPN boleh mempertimbangkan pengeluaran JPN.LM14 dengan fi RM10.00. \n','2023-03-13'),
(3,'cerai','TERMA DAN SYARAT\r\nPERMOHONAN STATUS PENGEMASKINIAN PERCERAIAN SIVIL\r\n\r\nSYARAT-SYARAT DAN MAKLUMAN UMUM:\r\n1. Permohonan ini adalah untuk perkahwinan yang didaftarkan di bawah Akta Membaharui Undang-undang (Perkahwinan dan Perceraian) 1976 [Akta 164] sahaja\r\n2. Status perkahwinan hanya boleh dikemaskini sekiranya perceraian/pembatalan perkahwinan telah didaftarkan di dalam sistem JPN\r\n3. Hanya suami/isteri (pemilik daftar perkahwinan) yang berkenaan sahaja dibenarkan membuat permohonan status pengemaskinian perceraian/ pembatalan sivil. Permohonan oleh pihak ketiga (peguam, waris dan sebagainya) adalah TIDAK DIBENARKAN.\r\n4. Pemilik daftar hendaklah mendaftar sebagai pengguna di aplikasi mobile JPN sebelum menggunakan perkhidmatan ini.\r\n5. Setiap cetakan surat keputusan dikenakan bayaran sebanyak RM5.00 (RINGGIT MALAYSIA LIMA SAHAJA)\r\n6. Surat Keputusan Pengemaskinian Rekod Perkahwinan (JPN. KC32) boleh dicetak setelah pembayaran dibuat.\r\n7. Bayaran yang telah dibuat TIDAK BOLEH DIKEMBALIKAN /DITUNTUT SEMULA. Sekiranya surat keputusan tidak dapat dicetak setelah bayaran dibuat atas sebarang sebab, pemohon adalah dikehendaki untuk ke mana-mana pejabat JPN untuk mendapatkan surat tersebut dengan membawa bukti pembayaran.\r\n8. Surat Keputusan Pengemaskinian Rekod Perkahwinan (JPN. KC32) adalah janaan komputer dan ditandatangani secara digital oleh Pendaftar Besar Perkahwinan.','2023-01-16'),
(4,'kp13','TERMA DAN SYARAT\nCABUTAN ALAMAT KP13\n\nARAHAN DAN SYARAT PERMOHONAN \n\nSila pastikan anda membaca dan memahami syarat-syarat dan arahan di bawah sebelum mengemukakan permohonan ini.  \n\n1. SYARAT-SYARAT AM \n\na) Agensi Kerajaan dan Badan Berkanun \nI. Permohonan Cabutan Daftar Alamat (JPN.KP13) boieh dibuat oleh Agensi Kerajaan dan Badan Berkanun; \n\nII. Permohonan JPN.KP13 akan diproses dalam tempoh (5) hingga sepuluh (10) hari bekerja bagi permohonan yang lengkap; \n\nIII. Bayaran proses adalah RM50.00 bagi setiap cabutan rekod yang dikeluarkan bagi Badan Berkanun sahaja. (Kutipan bayaran\nadalah secara atas talian); \n\nIV. Pemohon perlu memuat naik surat rasmi permohonan untuk tujuan semakan dan pengesahan; dan \n\nV. Permohonan yang memenuhi syarat-syarat yang ditetapkan sahaja akan diproses.  \n\nb) Firma Guaman mewakili syarikat \nI. Permohonan Cabutan Daftar Kad Alamat (JPN.KP13) boleh dibuat oleh Firma Guaman; \n\nII. Permohonan JPN.KP13 akan diproses dalam tempoh (5) hingga sepuluh (10) hari bekerja bagi permohonan yang lengkap ;\n\nIII. Bayaran proses adalah RM50.00 bagi setiap cabutan rekod yang dikeluarkan. (Kutipan bayaran adalah secara atas talian) ; \n\nIV. Pemohon perlu memuat naik dokumen seperti berikut ;  \ni. surat rasmi permohonan (tertera maklumat \nanak guam,  individu pemilik daftar, tujuan \npermohonan dan maklumat nombor sijil amalan guaman) ;  \nii. surat lantikan anak guam ;  \niii. dokumen bukti hubungan anak guam dengan pemilik daftar yang tertera nombor Kad Pengenalan seperti writ saman, perjanjian jual beli, perintah mahkamah, resit jualan, laporan polis, wasiat, SSM,  dan lain-lain dokumen yang bersesuaian untuk tujuan semakan dan pengesahan ; dan \nV. Hanya permohonan yang memenuhi syarat-syarat di atas sahaja akan diproses.  \n\nc) Firma Guaman mewakili individu \nI. Permohonan Cabutan Daftar Alamat (JPN.KP13) boleh dibuat oleh Firma Guaman; \n\nII. Permohonan JPN.KP13 akan diproses dalam tempoh (5) hingga sepuluh (10) hari bekerja bagi permohonan yang lengkap; \n\nIII. Bayaran proses adalah RM50.00 bagi setiap cabutan rekod yang dikeluarkan. (Kutipan bayaran adalah secara atas talian); \n\nIV. Pemohon perlu memuat naik dokumen seperti berikut ;  \ni. surat rasmi permohonan (tertera maklumat anak guam,  individu pemilik daftar, tujuan permohonan dan maklumat nombor sijil amalan guaman) ;  \nii. surat lantikan anak guam ;  \niii. Salinan kad pengenalan terkini anak guam yang disahkan oleh peguam; \niv. Dokumen bukti hubungan yang tertera nombor Kad Pengenalan anak guam dengan pemilik daftar seperti writ saman, perjanjian jual beli, perintah mahkamah, resit jualan, laporan polis, wasiat,  dan lain-lain dokumen yang bersesuaian untuk tujuan semakan dan pengesahan ; dan  \nV. Hanya permohonan yang memenuhi syarat-syarat di atas akan diproses.  \n\n2. ARAHAN  \n\na. Pemohon hendaklah mempunyai akaun pengguna untuk menggunakan perkhidmatan ini. Hanya pemohon yang berdaftar sahaja yang dibenarkan untuk mengemukakan permohonan ; \n\nb. Pemohon hendaklah memberi persetujuan sebelum mengisi dan mengemukakan permohonan Cabutan Daftar Kad Alamat JPN.KP13 ; \n\nc. Alamat E-mel dan No. Telefon yang didaftarkan semasa pendaftaran pengguna hendaklah maklumat yang masih aktif kerana maklumat ini akan digunakan sebagai medium perhubungan untuk sebarang pemakluman dan pengesahan yang berkaitan ; \n\nd. Pemohon hendaklah membaca dan memahami terma dan syarat yang telah dinyatakan sebelum membuat permohonan; \n\ne. Pemohon hendaklah merujuk Panduan Pengguna sebelum mengemukakan permohonan ; dan \n\nf. Sebarang kemusykilan boleh dirujuk di Soalan Lazim (FAQ) yang disediakan atau emel ke cabutandaftaronline@jpn.gov.my  \n\nPENGAKUAN PEMOHON \n\nDi bawah Peraturan 25(1)(b) Peraturan-Peraturan Pendaftaran Negara 1990, menjadi suatu kesalahan sekiranya seseorang memberikan maklumat palsu atau tidak benar untuk membuat permohonan cabutan daftar kad pengenalan adalah melakukan kesalahan dan jika disabitkan boleh dihukum penjara tidak melebihi tempoh 3 tahun atau denda tidak melebihi RM20,000.00 atau kedua-duanya.  \n\nSaya telah membaca dan memahami kandungan / maklumat sebagaimana yang tertera di atas. \n\nSegala butir-butir yang diberi dalam akuan ini sepanjang pengetahuan dan kepercayaan saya adalah benar dan saya faham bahawa jika dalam permohonan ini saya membuat sesuatu kenyataan palsu, saya boleh, apabila sabit kesalahan, dihukum penjara selama tempoh tidak lebih daripada tiga tahun atau denda tidak melebihi RM20,000.00 atau kedua-duanya.','2023-02-09'),
(5,'kahwin','TERMA DAN SYARAT CABUTAN DAFTAR PERKAHWINAN\r\n1. Permohonan ini adalah untuk perkahwinan yang didaftarkan di bawah Akta Membaharui\r\nUndang-undang (Perkahwinan dan Perceraian) 1976 [Akta 164] sahaja\r\n2. Status perkahwinan hanya boleh dikemaskini sekiranya perceraian/pembatalan\r\nperkahwinan telah didaftarkan di dalam sistem JPN\r\n3. Hanya suami/isteri (pemilik daftar perkahwinan) yang berkenaan sahaja dibenarkan\r\nmembuat permohonan status pengemaskinian perceraian/ pembatalan sivil. Permohonan\r\noleh pihak ketiga (peguam, waris dan sebagainya) adalah TIDAK DIBENARKAN.\r\n4. Pemilik daftar hendaklah mendaftar sebagai pengguna di aplikasi mobile JPN sebelum\r\nmenggunakan perkhidmatan ini.\r\n5. Setiap cetakan surat keputusan dikenakan bayaran sebanyak RM5.00 (RINGGIT MALAYSIA\r\nLIMA SAHAJA)\r\n6. Surat Keputusan Pengemaskinian Rekod Perkahwinan (JPN. KC32) boleh dicetak setelah\r\npembayaran dibuat.\r\n7. Bayaran yang telah dibuat TIDAK BOLEH DIKEMBALIKAN /DITUNTUT SEMULA. Sekiranya\r\nsurat keputusan tidak dapat dicetak setelah bayaran dibuat atas sebarang sebab, pemohon\r\nadalah dikehendaki untuk ke mana-mana pejabat JPN untuk mendapatkan surat tersebut\r\ndengan membawa bukti pembayaran.\r\n8. Surat Keputusan Pengemaskinian Rekod Perkahwinan (JPN. KC32) adalah janaan computer\r\ndan ditandatangani secara digital oleh Pendaftar Besar Perkahwinan.','2023-03-01');
